import "./ExpenseItem.css"

/**
 * 
 * @param {Date} date 
 */
function GetDayOfDate(date)
{
 return date.toLocaleString("en-US",{month:"long"});
}


function ExpenseItem ( props ) {
  
  return (
    <div className="expanse-item">
      <div>
        <div>{GetDayOfDate(props.date)}</div>
        <div>{props.date.toLocaleString("en-US",{year:"numeric"})}</div>
        <div>{props.date.toLocaleString("en-US",{day:"2-digit"})}</div>
      </div>
      <div className="expanse-item__description">
          <h2>{props.title}</h2>
          <div className="expanse-item__price">${props.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
